import React,{useState,useEffect} from 'react';
import {Container,Row,Col,Image,Button,Dropdown} from 'react-bootstrap';
import {useHistory}  from "react-router-dom";
import './LandingPage.scss';
const LandingPage = ()=>{
    let history = useHistory();
    const [goToHomePage,setHomePageFlag] = useState(0);
    useEffect(()=>{
        if({goToHomePage}===1){
            history.push('/home');
        }
        console.log(goToHomePage);
    });
        return (
           <Container fluid>
                <Row className = {"header"}>
                    <Col className={"logo"}>TaraTari  {goToHomePage}</Col>
                    <Col className>
                        <Dropdown>
                            <Dropdown.Toggle variant="success" id="dropdown-basic">
                                Select Items
                            </Dropdown.Toggle>
                            <Dropdown.Menu>
                                <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                                <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                                <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
                            </Dropdown.Menu>
                        </Dropdown>
                    </Col>
                    <Col className>
                        <Dropdown>
                            <Dropdown.Toggle variant="success" id="dropdown-basic">
                                Select Location
                            </Dropdown.Toggle>
                            <Dropdown.Menu>
                                <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                                <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                                <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
                            </Dropdown.Menu>
                        </Dropdown>
                    </Col>
                    <Col>
                        <Image className = {"search-icon"} alt='' src={require("../assets/search.png")}/>
                    </Col>
                    <Col>
                        <Button className={"sell-button"}>SELL</Button>
                    </Col>
                </Row>
                <Row>
                    <Col>
                        <Image  src={require("../assets/c8aa7a41b257939d2ee64cc128b297ec.jpg")} fluid/>
                    </Col>
                    <Col  className = {"right-sidebar"}>
                        <Row className = {"heading"} >Why TaraTari?</Row>
                        <Row> <p>INSTANT SELL & BUY ANY ITEM</p></Row>
                        <Row> <p>FREE LISTING</p></Row>
                        <Row> <p>QUICK RESPONSE FROM GENUINE BUYERS AND SELLERS</p></Row>
                        <Row ><Button onClick = {()=>{setHomePageFlag(1)}} className={"explore-button"} >EXPLORE</Button></Row>
                    </Col>
                </Row>   
            </Container>

    );
};

export default LandingPage;
